import Card from './components/Card/Card.js'
import Header from './components/Header/Header.js'
import Drawer from './components/Drawer/Drawer.js'
const arr = [
  { name: 'ЦВК Экспоцентр', count: 24 },
  { name: 'НьюЭкспо', count: 28 },
  { name: 'Abbott', count: 20 },
  { name: 'КВЦ "ЭКСПОФОРУМ"', count: 24 },
  { name: 'КВЦ "ЭКСПОФОРУМ"', count: 24 },
  { name: 'КВЦ «Сокольники»', count: 36 }
];
function App() {
  return (<div className="App clear">
    <Drawer />
    <Header />
    <div className="content p-40">
      <div className="mb-40 d-flex justify-between align-center">
        <h1 >Компании Участники</h1>
        <div className="Search-block d-flex align-center">
          <img src="/img/Btn/search.svg"></img>
          <input placeholder="Поиск..."></input>
        </div>
      </div>
      <div className='d-flex'>
        {
          arr.map((obj) => <Card />)
        }
      </div>
    </div>
  </div>
  );
}
export default App;
